VALUES ('3554748001005', 'Tisane Mieux Dormir Bio - 20 Sachets - Romon Nature', 'LA TISANE CONCENTREE MIEUX DORMIR La triple concentration MÉLISSE BIO / PASSIFLORE BIO permet donc d\'apporter plus de plantes dans votre tasse. La PASSIFLORE est utilisée pour faciliter le sommeil et contribue à une bonne relaxation. La MÉLISSE est une plante parfumée (légèrement citronnée), utilisée depuis très longtemps pour ses effets calmants, relaxants et digestifs. Le TILLEUL est utilisé en infusion depuis l\'antiquité pour aider à trouver le sommeil. L\'ORANGER apporte à cette tisane douceur et saveur. Ne pas donner aux enfants Conseils d\'utilisation : Laissez infuser votre sachet dose de tisane concentrée Mieux Dormir dans une tasse d\'eau très chaude pendant 5 à 6 minutes. A consommer après le diner ou 1 heure avant le coucher.', '0', '0', '0', '0', '0', '0', '0', '0', '', '1');

